import React, { useState, useEffect } from "react";
import { Navbar } from "../index";
import "./Pickup.css";

function Pickup() {
  // State to store the fetched parcel IDs
  const [parcelIDs, setParcelIDs] = useState([]);

  // Fetch parcel IDs when the component mounts
  useEffect(() => {
    fetch("http://localhost:3333/Shipping")
      .then((response) => response.json())
      .then((data) => {
        if (data.status === "ok") {
          // Assuming the parcel IDs are in an array named 'parcels'
          setParcelIDs(data.parcels);
        } else {
          console.error("Error fetching parcel IDs:", data.message);
        }
      })
      .catch((error) => {
        console.error("Error fetching parcel IDs:", error);
      });
  }, []);

  return (
    <div>
      <Navbar />
      <div className="Pickup-container" id="container">
        <div className="Pickup-form-container">
          <form>
            <h1 className="header">Pickup request</h1>
            <span>select location and date for pickup service</span>
            <br />
            <br />

            <div className="form-group row">
              <label htmlFor="" className="col-sm-4 col-form-label">
                <span className="lb_IDCard">Select parcel</span>
              </label>
              <div className="enterdata">
                <select id="selector">
                  {/* Map through parcelIDs to generate options */}
                  {parcelIDs.map((parcelID, index) => (
                    <option key={index} value={parcelID}>
                      {parcel_ID}
                    </option>
                  ))}
                </select>
              </div>
            </div>
            <div class="form-group row">
              <label for="" class="col-sm-4 col-form-label">
                <span class="lb_IDCard">Pickup date</span>
              </label>
              <div class="enterdata">
                <input type="date" />
              </div>
            </div>
            <br />
            <div class="form-group row">
              <label for="" class="col-sm-4 col-form-label">
                <span class="lb_IDCard">Pickup time</span>
              </label>
              <div class="enterdata">
                <select id="selector">
                  <option value="0">10:00 - 13:00</option>
                  <option value="1">13:00 - 15:00</option>
                  <option value="2">15:00 - 17:00</option>
                </select>
              </div>
            </div>
            <br />
            <div class="form-group row">
              <label for="" class="col-sm-4 col-form-label">
                <span class="lb_IDCard">Pickup location detail</span>
              </label>
              <div class="enterdata">
                <input
                  type="Address details"
                  placeholder="Enter address details"
                />
              </div>
            </div>
            <br />
            <div class="form-group row">
              <label for="" class="col-sm-4 col-form-label">
                <span class="lb_IDCard">s
                  Provinces/District/Sub-district/zip code
                </span>
              </label>
              <div class="enterdata">
                <select id="selector">
                  <option value="0">BKK</option>
                  <option value="1">Samut prakarn</option>
                </select>
              </div>
            </div>
            <br />
            <button>submit</button>
          </form>
        </div>
      </div>
    </div>
  );
}

export default Pickup;
